import styled from 'styled-components'

const Hamburger = styled.nav`
position: sticky;
top: 0;
z-index: -2;
height: 80px;
box-shadow: 0px 2px 10px rgba(0, 0, 0, 0.15);
display: flex;
justify-content: center;
align-items: center;`

const List = styled.li`
height: 80px;
`


export const NavBar = () => {
  return(
    
    <Hamburger>
      
      <List>
        <ul>Home</ul>
        <ul>Recipes</ul>
        <ul>Find Recipe</ul>
      </List>
    </Hamburger>

  )
}
